// src/components/FeaturedCarousel.js
import React from 'react';
import Slider from 'react-slick';
import "slick-carousel/slick/slick.css"; 
import "slick-carousel/slick/slick-theme.css";
import './FeaturedCarousel.css';  // Assuming we add styles in a separate file

const FeaturedCarousel = () => {
  const settings = {
    dots: true,
    infinite: true,
    speed: 600,
    slidesToShow: 1,
    slidesToScroll: 1
  };

  return (
    <Slider {...settings}>
      <div>
        <h3>SpectraForce X Series</h3>
        <div className="carousel-image-wrapper">
          <img 
            src="https://site-cdn.core.nytro.ai/static/media/8696ff32-464c-47e9-8b84-ff9cc88bed8e.png" 
            alt="Featured 1" 
            className="carousel-image"
          />
        </div>
        <button>Shop Now</button>
      </div>
      <div>
        <h3>EdgeNexus Platform</h3>
        <div className="carousel-image-wrapper">
          <img 
            src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTkb3w6W1OwmfySgI4VL2LTi1mJ9pt0Yfq1dA&s" 
            alt="Featured 2" 
            className="carousel-image"
          />
        </div>
        <button>Shop Now</button>
      </div>
    </Slider>
  );
};

export default FeaturedCarousel;
